import bisect
class Solution:
    def maximumWhiteTiles(self, tiles: List[List[int]], carpetLen: int) -> int:
        L = len(tiles)
        tiles.sort()
        # 预处理
        tile_nums = [r-l+1 for l,r in tiles]
        rs = [r for _, r in tiles]
        pre_sums = [0]
        for n in tile_nums:
            pre_sums.append(pre_sums[-1]+n)
        
        res = 0
        for i, t in enumerate(tiles):
            li, ri = t
            lc, rc = li, li+carpetLen-1
            idx = bisect.bisect_right(rs, rc)
            cur = pre_sums[idx]-pre_sums[i]
            if idx < L and tiles[idx][0] <= rc:
                cur += rc - tiles[idx][0] + 1
            res = max(res, cur)
            if idx == L:
                return res
        return res

